query BlogPostByPath(
  $path: String!
) {
  site {
    siteMetadata {
      disqus
    }
  }
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    html
    frontmatter {
      path
      date(formatString: "MMMM DD, YYYY")
      title
      attachments {
        filename
      }
      related {
        post
      }
    }
  }
  allMarkdownRemark {
    edges {
      node {
        frontmatter {
          title
          path
        }
      }
    }
  }
}

